(async function (Scratch) {
    "use strict";
    const { GoogleGenAI } = await import("https://cdn.jsdelivr.net/npm/@google/genai@1.33.0/+esm")
    let ai = new GoogleGenAI({apiKey: ""});
    let instruction = "";
    let key = "No API key has been set.";
    let modelChoice = "Gemini 2.5 - Flash";
    const blockIconURI = "data:image/svg+xml;base64,";
    const menuIconURI = blockIconURI;
    const actualModels = ["gemini-2.5-flash-lite", "gemini-2.5-flash", "gemini-2.5-pro", "gemini-3-flash-preview", "gemini-3-pro-preview", "gemini-3-deep-think"];
    const displayModels = ["Gemini 2.5 - Flash Lite", "Gemini 2.5 - Flash", "Gemini 2.5 - Pro", "Gemini 3 - Flash (Preview)", "Gemini 3 - Pro (Preview)", "Gemini 3 - Deep Thinking"];
    class Gemini {
        getInfo() {
            return {
                id: "gemini",
                name: Scratch.translate("Gemini"),
                color1: "#0086c9",
                menuIconURI,
                blockIconURI,
                blocks: [
                    {
                        opcode: "generate",
                        blockType: Scratch.BlockType.REPORTER,
                        text: Scratch.translate(
                            "generate from [contents] and temperature of [temp]"
                        ),
                        arguments: {
                            contents: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "Tell me about Gemini.",
                            },
                            temp: {
                                type: Scratch.ArgumentType.NUMBER,
                                defaultValue: 1,
                            },
                        },
                    },
                    {
                        opcode: "getKey",
                        blockType: Scratch.BlockType.REPORTER,
                        text: Scratch.translate(
                            "current API key"
                        ),
                    },
                    {
                        opcode: "getModel",
                        blockType: Scratch.BlockType.REPORTER,
                        text: Scratch.translate(
                            "selected model"
                        ),
                    },
                    {
                        opcode: "setKey",
                        blockType: Scratch.BlockType.COMMAND,
                        text: Scratch.translate("set API key to [key]"),
                        arguments: {
                            key: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "",
                            },
                        },
                    },
                    {
                        opcode: "setInstruction",
                        blockType: Scratch.BlockType.COMMAND,
                        text: Scratch.translate({
                            default: "set personality to [personality]",
                        }),
                        arguments: {
                            personality: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "",
                            },
                        },
                    },
                    {
                        opcode: "setModel",
                        blockType: Scratch.BlockType.COMMAND,
                        text: Scratch.translate({
                            default: "use model [model]",
                        }),
                        arguments: {
                            model: {
                                type: Scratch.ArgumentType.STRING,
                                menu: "models",
                            },
                        },
                    },
                ],
                menus: {
                    models: displayModels
                },
            };
        }
        async generate(args) {
            const response = await ai.models.generateContent({
                model: getActualModel(modelChoice),
                contents: Scratch.Cast.toString(args.contents),
                config: {
                    systemInstruction: instruction,
                    temperature: Scratch.Cast.toFloat(args.temp),
                },
            });
            return response.text;
        }
        setKey(args) {
            key = Scratch.Cast.toString(args.key);
            ai = new GoogleGenAI({ apiKey: key });
        }
        setInstruction(args) {
            instruction = Scratch.cast.toString(args.personality);
        }
        setModel(args) {
            modelChoice = Scratch.Cast.toString(args.model);
        }
        getKey(args) {
            return key;
        }
        getModel(args) {
            return modelChoice;
        }
        getActualModel(display){
            return actualModels[displayModels.indexOf(display)];
        }
    }
    Scratch.extensions.register(new Gemini());
})(Scratch);
